query:
SELECT id, name, currentReplacementValue, deferredMaintenanceCost, status, city, province, 
CASE WHEN currentReplacementValue > 0 THEN ROUND((deferredMaintenanceCost / currentReplacementValue) * 100, 2) ELSE 0 END as FCI
FROM projects ORDER BY id DESC LIMIT 20;

